      <p>
        Design Patterns covered in this project are:
        <ul>
          <li>
            Controller: Single handler design pattern
            &nbsp;
            &nbsp;
            <Link to="\login">LOGIN </Link>
          </li>
        </ul>
      </p>
    </>
  );
};
export default Welcome;
